import React from 'react';
import Button from '@material-ui/core/Button'
import { Typography } from '@material-ui/core';


const buttonTestPage = () => <Button variant="contained" size="small">
    Press me
    </Button>


function testPage() {
    return (
        <>
            {buttonTestPage}
            <Typography>
                Hellou
            </Typography>
        </>
    )
}


export default testPage;
